import React from "react";
import web from "../src/images/artboard.png";

const Service = () => {
  return (
    <>
      <h1 className="text-center pb-4">Our Services</h1>
      <div className="container">
        <div className="row gy-4"></div>
      </div>
    </>
  );
};

export default Service;
